declarations.description:
Badges show notifications, counts, or status information on
navigation items and icons.
@see https://m3.material.io/components/badges/specs

Returns array of elements that *may* be focusable over tab
@param {Node} root
@return {Element[]}

Floating action buttons (FABs) help people take primary actions.
@see https://m3.material.io/components/floating-action-button/specs
@see https://m3.material.io/components/extended-fab/specs

Filter chips use tags or descriptive words to filter content.
They can be a good alternative to toggle buttons or checkboxes.
@see https://m3.material.io/components/chips/specs

List item representing a single row in a list; supports leading/trailing
content, selection, and accessibility features.
@see https://m3.material.io/components/lists/specs

Listbox: a selectable list of options, used for autocompletes and selects.
implements {HTMLSelectElement}
@see https://m3.material.io/components/lists/specs

Menus provide a list of choices or actions in a temporary surface.
@see https://m3.material.io/components/menus/specs
@see https://www.w3.org/TR/wai-aria-practices/#menu

Menu items represent selectable options within a menu. They can trigger
actions, toggle state, or open nested submenus.
@see https://m3.material.io/components/menus/specs

A navigation bar item represents a destination within a navigation bar,
providing an icon and optional label to help users move between app sections.
@see https://m3.material.io/components/navigation-bar/specs

A navigation drawer item represents a destination inside a navigation drawer,
showing an icon, label, and optional badge to help users navigate app sections.
@see https://m3.material.io/components/navigation-drawer/specs

Navigation rails provide access to app destinations and destinations-level
navigation in a vertical rail, suited for larger screens and desktop layouts.
@see https://m3.material.io/components/navigation-rail/specs

A navigation rail item represents a destination within a navigation rail,
showing an icon and optional label for vertical navigation on larger screens.
@see https://m3.material.io/components/navigation-rail/specs

Page is a top-level layout container that manages single or multi-pane
application layouts, adapting to viewport size to show one or two panes.
@see https://m3.material.io/foundations/layout/applying-layout/window-size-classes

Popup displays transient content such as menus or popovers and provides
elevation, shape, and theming control for floating surfaces.
@see https://m3.material.io/styles/elevation/overview

Progress indicators display the progress of an operation as a determinate
bar or an indeterminate animation.
@see https://m3.material.io/components/progress-indicators/specs
@see https://html.spec.whatwg.org/multipage/form-elements.html#the-progress-element

Root is the application's top-level container that manages layout regions and
shared floating areas such as bottom bars.
@see https://m3.material.io/foundations/layout/applying-layout/window-size-classes

A scrim can bring focus to specific elements by increasing the visual contrast of a large layered surface.
Use the scrim beneath elements like modals and expanded navigation menus.
@see https://m3.material.io/styles/elevation/applying-elevation

Search provides an app bar integrated search field for querying content.
implements {HTMLSelectElement}
@see https://m3.material.io/components/search/overview

Select provides a control for choosing an option from a list of options.
implements {HTMLSelectElement}
@see https://m3.material.io/components/text-fields/overview

@param {string} value
@param {number} onNaN
@return {number}

Snackbar container positions snackbars within the app window and manages
layout and pointer-events for stacked snackbars.
@see https://m3.material.io/components/snackbar/specs

Surface represents a themed elevated surface used to display content with
elevation, shape, and color tokens applied.
@see https://m3.material.io/styles/elevation/overview

Tabs organize content into separate views where only one view is visible
at a time; tabs provide navigation between those views.
@see https://m3.material.io/components/tabs/specs

Tab content hosts tab panels and manages which panel is visible based on
scroll position or selected tab.
@see https://m3.material.io/components/tabs/specs

Tab list is the container for `mdw-tab` elements and renders the active
indicator and keyboard navigation behavior.
@see https://m3.material.io/components/tabs/specs

TabPanel represents the content area for a single tab and updates ARIA
when activated.
@see https://m3.material.io/components/tabs/specs

@param {Element} parent
@param {string} tagName
@return {Element?}

TextArea is a multi-line text input that auto-resizes and integrates with
text-field patterns for labels and validation.
implements {HTMLTextAreaElement}
@see https://m3.material.io/components/text-fields/specs
@see https://html.spec.whatwg.org/multipage/form-elements.html#the-textarea-element
